package com.baizhi.entity;import java.io.Serializable;/** * Created by dell on 2018/6/3. */public class ProvinceVO implements Serializable {    private String name;    private String value;    public ProvinceVO(String name, String value) {        this.name = name;        this.value = value;    }    @Override    public String toString() {        return "ProvinceVO{" +                "name='" + name + '\'' +                ", value='" + value + '\'' +                '}';    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getValue() {        return value;    }    public void setValue(String value) {        this.value = value;    }    public ProvinceVO() {    }}